  "text" : "\uC0C1\uC2E4\uD588\uB2E4\uACE0 \uBCF4\uAE30 \uC5B4\uB824\uC6B4 \uC810, \uD615\uBC8C\uC5D0 \uB300\uD55C \uC704\uD5CC \uACB0\uC815\uC740 \uC7AC\uC2EC\uCCAD\uAD6C\uC758 \uADFC\uAC70\uAC00 \uB418\uB294 \uC810 \uB4F1\uC744 \uACE0\uB824\uD560 \uB54C \uAC00\uB2A5\uD55C \uC704\uD5CC\uC778 \uBD80\uBD84\uC744 \uAC00\uB824\uB0B4\uC57C \uD560 \uD544\uC694\uC131\uC740 2010\uD5CC\uAC002 \uACB0\uC815\uC5D0\uC11C\uC640 \uB9C8\uCC2C\uAC00\uC9C0\uB85C \uC778\uC815\uB41C\uB2E4. \uC774 \uC0AC\uAC74 \uC2EC\uD310\uB300\uC0C1 \uC870\uD56D\uB4E4 \uAC00\uC6B4\uB370, \uADDC\uC81C\uAC00 \uBD88\uAC00\uD53C\uD558\uB2E4\uACE0 \uBCF4\uAE30",
