  "text" : "\uD639\uC740 \uAE30\uC774\uD55C \uC0AC\uAC74\uC774\uB098 \uD604\uC0C1\uC744 \uC8FC\uB41C \uBCF4\uB3C4\uC758 \uB300\uC0C1\uC73C\uB85C \uB2E4\uB8E8\uB294 \uAC83\uC744 \uC120\uC815\uC801 \uBCF4\uB3C4\uB77C\uACE0 \uADDC\uC815\uD560 \uC218 \uC788\uB2E4.\n\n- \uBC15\uC9C4\uC6B0 (\uD55C\uAD6D\uC5B8\uB860\uC9C4\uD765\uC7AC\uB2E8 \n\uC120\uC784\uC5F0\uAD6C\uC704\uC6D0), \"\uC120\uC815\uC801 \uBCF4\uB3C4, \uC774\uB300\uB85C \uC88B\uC740\uAC00? - \uCD5C\uADFC\uC758 \uC8FC\uC694 \uC0AC\uB840\uB4E4\uC5D0 \uB300\uD55C \uC9C4\uB2E8\", \uAD00\uD6C8\uC800\uB110, 2011",
