  "text" : "\u2026\uC0AC\uC804\uC801 \uC758\uBBF8\uC5D0\uC11C \u2018\uC120\uC815\uC801 \uBCF4\uB3C4\u2019\uB780 \uBCF8\uB2A5\uACFC \uD638\uAE30\uC2EC\uC744 \uC790\uADF9, \uB300\uC911\uC758 \uC778\uAE30\uB97C \uB04C\uC5B4 \uC774\uB4DD\uC744 \uC5BB\uC73C\uB824\uB294 \uBCF4\uB3C4 \uACBD\uD5A5\uC744 \uC9C0\uCE6D\uD55C\uB2E4. \uC77C\uBC18\uC801\uC73C\uB85C \uB3C5\uC790\uB4E4\uC758 \uC815\uC11C\uC801\uC778(\uD754\uD788 \uB9D0\uCD08\uC801\uC778) \uAC10\uC815\uC744 \uC790\uADF9\uD558\uB294 \uBC94\uC8C4\uB098 \uD3ED\uB825, \uC131\uC5D0 \uAD00\uD55C \uAE30\uC0AC, \uC720\uBA85\uC778\uC758 \uC2A4\uCE94\uB4E4\uC774\uB098 \uBD80\uC815\uBD80\uD328,",
