  "text" : "\uC120\uC815\uC801 \uBCF4\uB3C4\uB294 \uC2E4\uB85C \uC5B8\uB860\uACC4 \uC804\uBC18\uC5D0 \uB9CC\uC5F0\uD574 \uC788\uB2E4. \uC8FD\uC740 \uC790\uC5D0 \uB300\uD55C \uBB34\uB840\uD568\uC740 \uADF8 \uD55C \uAC00\uC9C0 \uC0AC\uB840\uC77C \uBFD0\uC774\uB2E4. \uB9CE\uC740 \uACBD\uC6B0 \uC8FD\uC740 \uC790\uBCF4\uB2E4\uB294 \uC0B0 \uC790\uB4E4\uC774 \uB354 \uD070 \uCDA9\uACA9\uACFC \uD53C\uD574\uC5D0 \uC2DC\uB2EC\uB9AC\uAE30 \uB9C8\uB828\uC774\uB2E4. \uB610\uD55C \uADF8\uAC83\uC740 \uB2E8\uC9C0 \uC5F0\uC608\uC778\uB9CC\uC744 \uB300\uC0C1\uC73C\uB85C \uD558\uC9C0 \uC54A\uB294\uB2E4.",
