  "text" : "\uD604\uC2E4 \uB54C\uBB38\uC5D0 \uC5B4\uCA54 \uC218 \uC5C6\uB294 \uAC83\uC77C\uAE4C\uFF1F \uADF8\uB3C4 \uC544\uB2C8\uB77C\uBA74 \uD55C\uAD6D (\uC5F0\uC608) \uC800\uB110\uB9AC\uC998\uC758 \uAD6C\uC870\uC801 \uD2B9\uC131\uC0C1 \uC5B4\uCA54 \uC218 \uC5C6\uB294 \uC77C\uC77C\uAE4C\uFF1F \uC774 \uBAA8\uB450\uAC00 \uBC18\uB4DC\uC2DC \uADF8\uB807\uC9C0\uB9CC\uC740 \uC54A\uB2E4\uB294 \uC810, \uBB38\uC81C\uB294 \uBC14\uB85C \uC774\uAC83\uC774\uB2E4.\n\n\uC5F0\uC608\uACC4 \uC2A4\uD0C0\uB4E4\uC758 \uBD88\uD589\uD55C \uC18C\uC2DD\uC5D0 \uB300\uD55C \uC120\uC815\uC801 \uBCF4\uB3C4 \uD615\uD0DC\uB294 \uD761\uC0AC \uB3C5\uC790\uB4E4\uC758",
