  "text" : "\uACB0\uCF54 \uC790\uC2E0\uC758 \uCE7C\uB05D\uC744 \uAC70\uB450\uC9C0 \uC54A\uB294\uB2E4.\n\n\uC774\uAC83\uC740 \uC0AC\uAC74 \uC790\uCCB4\uAC00 \uADF8\uB9CC\uD07C \u2018\uBE45 \uC774\uC288\u2019\uC600\uAE30 \uB54C\uBB38\uC77C\uAE4C\uFF1F \uADF8\uB140\uAC00 \uB300\uC911\uC758 \uAD00\uC2EC\uC744 \uD55C \uBAB8\uC5D0 \uBC1B\uB294 20\uB300 \uBBF8\uBAA8\uC758 \uC5EC\uC131 \uBC29\uC1A1\uC778 \uD639\uC740 \uC5F0\uC608\uC778\uC774\uC5C8\uAE30 \uB54C\uBB38\uC77C\uAE4C\uFF1F \uD639\uC740 \uCD5C\uADFC \uC720\uBA85 \uC5F0\uC608\uC778\uB4E4\uC758 \uC790\uC0B4 \uC18C\uC2DD\uC774 \uC608\uAE30\uCE58 \uC54A\uAC8C \uC787\uB530\uB77C \uC804\uD574\uC9C0\uB294",
