  "text" : "\uC720\uB825 \uBA54\uC774\uC800 \uC5B8\uB860\uC740 \uACE0\uC778\uC758 \u201C\uACFC\uAC70 \uB0A8\uC131\uC7A1\uC9C0 \uD654\uBCF4\uC0AC\uC9C4\u201D\uC744 \uBC1C\uAD74\uD574\uB0B4\uB294 \u2018\uC131\uACFC\u2019\uB97C \uC62C\uB9AC\uAE30\uB3C4 \uD558\uC600\uB2E4. \uC720\uBA85\uC2A4\uD0C0\uB4E4\uACFC\uC758 \uAD00\uACC4\uB97C \uB458\uB7EC\uC2FC \uC18C\uBB38\uC740 \uB0B1\uB0B1\uC774 \uACF5\uAC1C\uB418\uC5C8\uACE0, \uC774\uC5D0 \uB300\uD55C \uC628\uAC16 \uCD94\uCE21\uBCF4\uB3C4\uAC00 \uAF2C\uB9AC\uB97C \uBB3C\uACE0 \uACC4\uC18D\uB418\uC5C8\uB2E4. \uC120\uC815\uC801\uC778 \uBCF4\uB3C4\uB294 \uC774\uB807\uB4EF \uC8FD\uC740 \uC790\uB97C \uD5A5\uD574\uC11C\uB3C4",
