  "text" : "\uC8FD\uC74C\uC758 \uD604\uC7A5\uC5D0 \uB300\uD55C \uB108\uBB34\uB098\uB3C4 \uC0C1\uC138\uD55C \uC124\uBA85\uC774 \uBAA9\uACA9\uC790, \uC544\uD30C\uD2B8 \uAD00\uB9AC\uC778, 119\uB300\uC6D0\uC758 \uC99D\uC5B8\uC744 \uD1B5\uD574 \uC804\uD574\uC84C\uB2E4. \uACBD\uD669\uC774 \uC5C6\uC744 \uAC00\uC871\uB4E4\uC5D0\uAC8C \uC8FD\uC74C\uC5D0 \uB300\uD574 \uC5B4\uCC0C \uC0DD\uAC01\uD558\uB290\uB0D0\uB294 \uB2E4\uC18C \u2018\uACBD\uC6B0 \uC5C6\uB294\u2019 \uCDE8\uC7AC\uB3C4 \uC774\uB8E8\uC5B4\uC84C\uB2E4. \uACE0\uC778\uC5D0 \uB300\uD55C \uC774\uB978\uBC14 \u2018\uC2E0\uC0C1 \uD138\uAE30\u2019\uB3C4 \uB04A\uC774\uC9C0 \uC54A\uC558\uB2E4.",
