  "text" : "\uADF8\uB807\uAE30 \uB54C\uBB38\uC5D0 \"\uD55C\uAD6D\uC778\uB4E4\uC774\uB791 \uC5B4\uC6B8\uB9B4\uAC70\uBA74 \uC720\uD559 \uC65C \uC654\uB0D0?\"\uB77C\uB294 \uB9D0\uC5D0 \uB3D9\uC758\uD560 \uC218 \uC5C6\uB2E4. \uADF8\uAC74 \uAC1C\uC778\uC801 \uC0AC\uC815 \uC544\uB2CC\uAC00. \uC720\uD559\uAE30\uAC04 \uB0B4\uB0B4 \uD5A5\uC218\uAC00 \uB108\uBB34 \uC2EC\uD574\uC11C \uD55C\uAD6D\uC778\uB4E4\uACFC \uC5B4\uC6B8\uB9AC\uB294 \uAC83\uC73C\uB85C \uB9C8\uC74C\uC744 \uB2EC\uB798\uBA74\uC11C \uADC0\uAD6D \uD55C \uBC88 \uC548\uD558\uACE0 \uD559\uBB38\uC801 \uC131\uACFC\uB97C \uC774\uB904 \uB3CC\uC544\uC628 \uC0AC\uB78C\uB4E4\uB3C4 \uB9CE\uC740\uB370.",
